import React from 'react';
import './editItem.css';

const EditItem = ({ item }) => {
  const defaultItem = {
    name: 'Sample Item',
    description: 'This is a sample item.',
    price: 100,
  };

  const { name, description, price } = item || defaultItem;

  return (
    <div className="edit-item">
      <h2>Edit Item</h2>
      <p>Name: {name}</p>
      <p>Description: {description}</p>
      <p>Price: {price}</p>
    </div>
  );
};

export default EditItem;
